import React from "react";
import {
    Container,
    Row,
    Col,
    Button,
    Modal,
    ListGroup,
    Spinner,
  } from "react-bootstrap";
import "./MainPage.css";
import Select from "react-select";

var options = [{ label: "1 queen", value: 1 }];

export default class MainPage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            board: []
        }
    }
    render() {
        return (
            <div className='web-container'>
                <div className='mainpart'>
                    <Spinner 
                    animation="border" 
                    role="status"
                    style={{display: 'none'}}>
                        <span className="sr-only">Loading...</span>
                    </Spinner>
                    <div className='sizeDecide'>
                        <div id='selection'>
                            <Select
                                style={{position: 'absolute', top: '50%'}}
                                onChange={(e) => {
                                console.log(e);
                                this.selectQueen(e);
                                }}
                                label="Select Queens"
                                options={options}
                            />
                        </div>
                        <div id='texts'>
                            <p>Backtracking Search for -queeen problem</p>
                        </div>
                    </div>
                    <div style={{backgroundColor:'rgba(0, 0, 0, 0.7)', width: '94%', height: '40%', marginTop: '3%', marginLeft: '3%', border: 'solid aqua 2px'}}>
                        <p style={{backgroundColor: 'green', height: '10%', color: 'white', fontWeight: 'bold', fontSize: '20px'}}>Specify Any Required location</p>
                    </div>
                </div>
            </div>
        );
    }
}
